import React from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceBook, faCoffee, faPinterest } from '@fortawesome/free-solid-svg-icons';
// import { logo.png } from "../images/logo.png";

import {
  Nav,
  Col,
  Image
} from 'react-bootstrap';

export default function FooterNav() {

  return (
      <Nav className='container-fluid d-flex justify-content-center text-center text-white bg-dark' >
            <Col>

            <div className="">
              <Link className="btn m-4" href="#"><Image src="https://www.iconsdb.com/icons/preview/white/twitter-xxl.png" width="50"/></Link>

              <Link className="btn m-4" href="#"><Image src="https://www.iconsdb.com/icons/preview/white/twitter-xxl.png" width="50"/></Link>

              <Link className="btn btn-outline-light m-4" href="#"><Image src="images/1.png" width="30"/></Link>

              <Link className="btn btn-outline-light m-4" href="#"><i className="faPinterest"></i></Link>
            </div>
            </Col>
     </Nav>
  );
}
